package br.org.acal.application.screen.splash;

import javax.imageio.ImageIO;
import javax.swing.ImageIcon;
import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import java.io.IOException;
import java.util.Base64;
import java.util.List;
import java.util.Random;

public class SplashImages {

    private final String AERO_LUCCA = "";

    public ImageIcon random(){
        var list = List.of(AERO_LUCCA);
        var randomItem = getRandomItem(list);

        return createImageIconFromBase64(randomItem);
    }

    public static <T> T getRandomItem(List<T> list) {
        return list.get(new Random().nextInt(list.size()));
    }

    private ImageIcon createImageIconFromBase64(String base64Image) {
        try {
            byte[] imageBytes = Base64.getDecoder().decode(base64Image);
            ByteArrayInputStream bis = new ByteArrayInputStream(imageBytes);
            BufferedImage bufferedImage = ImageIO.read(bis);
            return new ImageIcon(bufferedImage);
        } catch (IOException e) {
            return null;
        }
    }

}
